import React from "react";
import './Card.scss';

const VolunteeringCard: React.FC<{
  title: string;
  address: string;
  date: any;
  key: string; 
}> = (props) => {
  return (
        <div className="data-item">
        <div className="data-content">
          <p className="volunteering-card-title">{props.title}</p>
          <p className="volunteer-card-address">{props.address}</p>
          <p className="volunteer-card-date">{props.date}</p>
        </div>
      </div>
  );
};

export default VolunteeringCard;
